import React from 'react';

function ContactSlip() {
// 151C29,647692,4199E0,4CB1F3

    const contactSlipCont = {
        background: '#4199E0',
        color: '#eee',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '300px',

        padding: '30px',
    }

    const leftBlock = {
        // backgroundColor: 'red',
        width: '50%',
        height: '300px',
        borderRight: '1px solid #151C29'
    }

    const rightBlock = {
        // backgroundColor: 'green',
        width: '50%',
        height: '300px',
        display: 'flex',
        flexDirection: 'column',
    }

    const topBlock = {
        backgroundColor: 'red',
        display: 'flex',
        alignItems: 'center',
        height: '50%',
        margin: '0 0 10px 30px',
    }

    const bottomBlock = {
        display: 'block',
        height: '50%',
        backgroundColor: 'green',
        margin: '10px 0 0 30px',
    }

    const imgCont = {
        backgroundColor: 'yellow',
        display: 'block',
        height: '100%',
        width: '140px',
    }

  return (
    <div className="contactSlip" style={ contactSlipCont }>
        <div style={ leftBlock }>
            Contact Us
        </div>
        <div style={ rightBlock }>
            <div style={ topBlock }>
                <div style={ imgCont }></div>
            </div>
            <div style={ bottomBlock }>
                <div style={ imgCont }></div>
            </div>
        </div>
    </div>
  );
}

export default ContactSlip;
